import React from 'react';
import axios from 'axios';
import ReactTable from "react-table";

class UserPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {userName:props.userName,password:props.password};
    this.data = props.data;
  }
  renderTableData() {
      return this.data.map((details, index) => {
         const { id,userName, bookName, author,printDate } = details; //destructuring
         return (
            <tr key={id}>
               <td>{userName}</td>
               <td>{bookName}</td>
               <td>{author}</td>
            </tr>
         )
      })
   }
   renderTableHeader() {
      let header = Object.keys(this.data[0])
      return header.map((key, index) => {
         return <th key={index}>{key.toUpperCase()}</th>
      })
   }
  render(){
    return(
      <div>
      <table id='students'>
      <tbody>
      <tr>
        <th>Başlık</th>
      </tr>
      {this.renderTableData()}
      </tbody>
      </table>
      </div>
    );
  }
}
export default UserPage;
